def reverse_complement(input_sequence):
    d={"G":"C",
        "C":"G",
        "U":"A",
        "A":"U"}
    return "".join(d[i] for i in input_sequence)[::-1]

print(reverse_complement("GAGGC"), "GCCUC")
print(reverse_complement("UCUCG"), "CGAGA")
print(reverse_complement("CAGGU"), "ACCUG")
print(reverse_complement("UAUUUUUCCA"), "UGGAAAAAUA")
print(reverse_complement("GUAGGCAACA"), "UGUUGCCUAC")
print(reverse_complement("UAGCUAAAUC"), "GAUUUAGCUA")
print(reverse_complement("AUGAGCGUAC"), "GUACGCUCAU")
print(reverse_complement("UUAUACCCGAGUCGGAUUUGUCACU"), "AGUGACAAAUCCGACUCGGGUAUAA")
print(reverse_complement("CUUGUGCGCUAUACAUCGAGUAGUUGCUAGAGUAUGUUACUCAAGAGCGC"), "GCGCUCUUGAGUAACAUACUCUAGCAACUACUCGAUGUAUAGCGCACAAG")
print(reverse_complement("UUAACUGGGGUGAACUGUCCUGAGCCUAUGGAUCUGCGCGCAGGGCUUCAAAUGGAGUUCGGAAUGACCAUCGAUUCUCGAUGUUUGGCACGAAGUCGCA"), "UGCGACUUCGUGCCAAACAUCGAGAAUCGAUGGUCAUUCCGAACUCCAUUUGAAGCCCUGCGCGCAGAUCCAUAGGCUCAGGACAGUUCACCCCAGUUAA")
print(reverse_complement(""), "")
